import './App.css';
import React from 'react';
import logo from "./logo.svg";
import Axios from 'axios';

function App() {
  Axios({
    method: 'GET',
    url: "http://localhost:3000/",
    headers: {
      "Content-Type": "application/json"
    }
  })

  return (
    <div className="App">
       <h1>Moment One Platform</h1>
      </div>
  )}


export default App;
